import React from "react";
export default class GameNumber extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        console.clear();
        console.log(`Top Location: ${this.props.location.top} --- Left Location: ${this.props.location.left}`);
        console.log("_______________________________________________________________________");

        return(
            <div id={this.props.id} style={{top: `${this.props.location.top}px`, left: `${this.props.location.left}px`}} className={`gameNumber gameNumber${this.props.val}`}>
                <span className={`number number${this.props.val}`}>{this.props.val}</span>
            </div>
        );
    }
}
